import Footer from '../subscript/universal/Footer'

const About = () => {
    return (  
        <div className="About">
             <div id="page-container">
                <div id="content-wrap">
                    <Nav />
                    
                    <h2>This is the About page</h2>
                </div>

                {/* Footer */}
                <Footer />
            </div>
        </div>
    );
}
 
export default About;
